template.body:
query User($params: GetUsersParams!) {
  getUsers(params: $params) {
    __typename
    ... on User {
      userId
      name
      profilePicUrl
      email
      isActive
      phoneNumber {
        dialCode
        iso2CountryCode
        phoneNumber
      }
      isAdmin
      lastName
      firstName
      gender
      dob
      permissions
      manager {
        userId
        name
        profilePicUrl
        email
        isActive
      }
      identifications {
        ... on RoleConfig {
          identificationId
          name
          identificationType
          profilePicUrl
          actions
          pipelines {
            pipelineId
            name
            pipelineItemType
          }
        }
        ... on UserGroupConfig {
          identificationId
          name
          identificationType
          profilePicUrl
          actions
          users {
            userId
            name
            profilePicUrl
            email
            isActive
          }
        }
      }
      hasFirebaseAppAccess
    }
    ... on UserNotFound {
      message
    }
  }
}

