mutation CreateUser($inputArguments: CreateUserParams!) {
  createUser(params: $inputArguments) {
    __typename
    ... on User {
      userId
      name
      profilePicUrl
      email
      phoneNumber {
        dialCode
        iso2CountryCode
        phoneNumber
      }
      isAdmin
      lastName
      gender
      dob
      permissions
      manager {
        userId
        name
        profilePicUrl
      }
    }
    ... on UserAlreadyExistWithEmail {
      message
      email
    }
    ... on UserIsNotAnAdministrator {
      message
    }
    ... on InvalidPhoneNumber {
      message
      InvalidPhoneNumber: phoneNumber
      dialCode
      iso2CountryCode
    }
    ... on InvalidEmail {
      message
      email
    }
    ... on UserEmailAlreadyExistsInAnotherAccount {
      message
    }
  }
}

