// Tip: assign your external references to variables instead of chaining off the curly brackets.
const userPropertiesGOFs = {{GetUserPropertiesFromUserAppConfig.data?.getUserAppConfig?.userPropertiesTemplate?.gofs.filter(section => section.category == "CUSTOM_GOF")}} || [];
const fields = userPropertiesGOFs.reduce((fieldsArray, gof) =>{
  const orderedFieldIds = gof.orderedFieldIds;
  const gofFields = orderedFieldIds.map((fieldId) => {
    const field = gof.fields.find((gofField) => gofField.fieldId===fieldId)
    return field
  })
  return [...fieldsArray, ...gofFields]
},[])
return fields

