mutation SetFieldsSelectorFieldOptionDependentFieldsOrder($params: SetFieldsSelectorFieldOptionDependentFieldsOrderParams!) {
  setFieldsSelectorFieldOptionDependentFieldsOrder(params: $params) {
    __typename
    ... on SetFieldsSelectorFieldOptionDependentFieldsOrderResult {
      fieldId
      option
      dependentFieldIds
    }
    ... on FieldNotFound {
      message
      fieldId
    }
    ... on NotFieldsSelectorField {
      message
      fieldId
    }
    ... on FieldIsDeleted {
      message
      fieldId
      systemFieldEnum
    }
    ... on UserIsNotAnAdministrator {
      message
    }
    ... on CannotEditSystemField {
      message
      fieldId
    }
    ... on OptionShouldBeInExistingOptions {
      message
      option
    }
    ... on NotGivenExistingDependentFieldIds {
      message
      dependentFieldIds
    }
    ... on GivenNonExistingDependentFieldIds {
      message
      dependentFieldIds
    }
    ... on DuplicateDependentFieldIds {
      message
      dependentFieldIds
    }
  }
}

