const payload = {
     activity_reference_id: activities_table.selectedRow.data?.referenceId,
    activity_details: activities_table.selectedRow.data?.gofs.reduce((acc, gof) => [...acc, ...gof.fields],[]).filter((field) => Boolean(field.referenceId)).map((field) => ({field_reference_id: field.referenceId,value:window.fieldTypeDefaultValues[field.fieldType]})),
}
let textElement;
if (activity_identification_tabs.selectedLabel == "Custom ID"){

  payload.contact_identification_type = "CUSTOM_ID"
  payload.custom_id_details = {
    field_reference_id: select_custom_id.selectedItem.referenceId,
    value: "5427d519-1bdb-41bc-aa67-42797eec4766"
  }
  textElement = activity_curl_for_custom_id

}
else if (activity_identification_tabs.selectedLabel == "Email"){

  payload.contact_identification_type = "EMAIL"
  payload.email = "sample.email@gmail.com"
  textElement = activity_curl_for_email

}
else if (activity_identification_tabs.selectedLabel == "Phone Number"){

  payload.contact_identification_type = "PHONE_NUMBER"
  payload.phone_number = {"phone_number": "9876543210", "dial_code": "+91", "iso2_country_code": "IN"}
  textElement = activity_curl_for_phone_number

}



const snippet = new HTTPSnippet({
  method: 'POST',
  url: window.activityURL,
  headers: [{name: "x-api-key",value:"ABCDEFGHIJKLMNOPQRSTUVWXYZ"}, {name:"content-type",value:"application/json"}],
  postData: {
            "mimeType": "application/json",
            "text": JSON.stringify(payload)
          }

});

const options = { indent: '\t' };
const output = snippet.convert('shell', 'curl', options);
// textElement.setValue(output)

return output

